import react from "react";
import {Link} from "react-router-dom";
import styled from "styled-components";

const Navbar = () => {
    const handleChangeSelection = (value) => {
        console.log(value);
        window.location.href = String("/" + value);
    };
    const StyledLink = styled(Link)`
    display: inline-block;
    position: relative;
    color:royalblue;
    text-decoration: none;
    &:hover{
        color:red;
    }
    `;
    return (
        <nav className="navbar-expand">
            <div className="navbar nav1 bg-dark">
                <div className="navbar bg-dark">
                    <ul className="navbar-nav mr-auto">
                        <li>
                            <StyledLink to="/home" className="navbar-brand navbar-item"><h1 className="h1">homepage</h1></StyledLink>
                        </li>
                        <li>
                            <StyledLink to="/signin" className="navbar-brand navbar-item"><h1 className="h1">Sign in</h1></StyledLink>
                        </li>
                        <div className="">
                            <li className="bg-dark">
                                <select className="bg-dark navbar-brand navbar-item dropdown" onChange={event => handleChangeSelection(event.target.value)}>
                                    <option className="options" value="">Select</option>
                                    <option className="options" value="signin">Sign in</option>
                                    <option className="options" value="home">Home</option>
                                    <option className="options" value="reeses">Reeses</option>
                                </select>
                            </li>
                        </div>
                    </ul>
                </div>
            </div>
        </nav>
    )
}

export default Navbar;
